    return (
        <>
            <Header />
            <div className="bg-gradient-to-b from-black via-black to-transparent before:bg-gradient-to-b before:from-black before:via-black before:to-transparent before:absolute before:inset-0 before:content-'' bg-cover bg-center h-screen" style={{ backgroundImage: `url("../Assets/bgImage.jpeg")` }}>
            </div>
            <SearchFilter/>
            <Footer />
        </>
    )
}

export default Home;
